package gallery

import play.api.libs.json.Json
import play.api.mvc.{Action, Controller}

object Gallery extends Controller {

  def index = Action { implicit request =>
    Ok(
      gallery.html.index()
    )
  }

  def getImage(i: Int) = Action { implicit request =>
    Thread.sleep(300)
    Ok(
      "data:image/jpg;base64,"
    )
  }

  def getImages = Action { implicit request =>
    Thread.sleep(300)
    Ok(
      Json.parse(
        List.fill(60)("data:image/jpg;base64,").mkString("[\"", "\",\"", "\"]")
      )
    )
  }
}
